import React from "react";

import {
  ProjectsContainer,
  ProjectsWrapper,
  ProjectsH2,
  ProjectsP,
} from "../ProjectsSection/ProjectsStyles";

export default function Projects() {
  return (
    <>
      <ProjectsContainer>
        <ProjectsWrapper id="projects">
          <ProjectsH2>Projects</ProjectsH2>
          <ProjectsP>Filter there projects here</ProjectsP>
        </ProjectsWrapper>
        <Card />
      </ProjectsContainer>
    </>
  );
}
